import React, { useEffect, useState } from 'react';
import {Line} from 'react-chartjs-2'
import GetData from './GetData';




const CovidChart = () => {
  var covidData = GetData();
  const[graphData, setData] = useEffect(null);

    return ( 
       <div>
           <button onClick = {() => {covidData = GetData(-7)}}>1W</button>
           <button>1M</button>
           <button>3M</button>
        <Line
          data={{
            labels: covidData.labels,
            datasets: [
              {
                label: "NSW",
                data: covidData.nswCases,
                fill: false,
                borderColor: "#36a2eb",
                tension: 0.1,
              },
              {
                label: "Vic",
                data: covidData.vicCases,
                fill: false,
                borderColor: "#ff6384",
                tension: 0.1,
              }
            ],
          }}
        />
      </div>
    );
}

export default CovidChart;
